import TypingCustom from '../components/TypingCustom'

const Index = () => (
    <div className='grid'>
        <div className='left'>
            <p>
                Hello there.
            </p>
        </div>
        <div className='right'>
            <p>
                <TypingCustom title='edward' delay='500' />
            </p>
        </div>
        <style jsx>{`
        .header {
            font-size: 40px;
            font-weight: 700;
            line-height: 1.2;
            color: #486491;
            margin: 20px auto;
            font-family: 'Arial';
        }
      `}</style>
    </div>

);

export default Index;
